DROP TABLE IF EXISTS `publication`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `publication` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int unsigned NOT NULL,
  `geolacation` varchar(100) DEFAULT NULL COMMENT 'Геолокация поста',
  `content_id` int unsigned DEFAULT NULL,
  `publication_types_id` int unsigned DEFAULT NULL COMMENT 'Тип публикации',
  `body` text NOT NULL,
  `is_public` tinyint(1) DEFAULT '1',
  `views_counter` int unsigned DEFAULT '0',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `publication_users_content_id_fk` (`user_id`),
  KEY `publication_content_id_fk` (`content_id`),
  KEY `publication_types_id_fk` (`publication_types_id`),
  CONSTRAINT `publication_content_id_fk` FOREIGN KEY (`content_id`) REFERENCES `content` (`id`) ON DELETE SET NULL,
  CONSTRAINT `publication_types_id_fk` FOREIGN KEY (`publication_types_id`) REFERENCES `publication_types` (`id`) ON DELETE SET NULL,
  CONSTRAINT `publication_users_content_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

